import './main.css'
const Main = () => {
    
    return ( 

        <>
        <h6 className="text-center m">HELLO,I AM</h6>
        <h2 className="name text-center text-white">ABDUL HANNAN</h2>
        <h6 className="text-center m">I AM A SOFTWARE ENGINEER.</h6><br />
        
        <button type="button" className="btn btn-lg btn-outline-danger mt-3" data-toggle="collapse"
         data-target="#demo">MORE</button> <br /> <br />
         <h3 className="text-center mt-4 collapse show" id="demo">I am MERN STACK Developer. <br /> I have expertise in REACT JS,NODE JS,<br /> EXPRESS and MONGO DB.
        For  Web <br /> Designing, I am expert in HTML5,CSS3 <br /> and BOOTSTRAP4.</h3>
        
        <br /><br /> <br />
        </>
     );
}
 
export default Main;
